('SGI Fácil - MODELO', 'a', 'http://sgimodelo.com.br', 'SGI Modelo', '650', '7cbe7a1efabb7b5ee48ffe47e922692f.jpg', 'Imóveis em Jardim das Flores - OSASCO', 'imóveis, alugúel, compra, venda, locação, administração', 'e50ecdd0ece6a5627937bd882f0e487f.jpg', 200, 100, 55, 75, 'FFFFFF', '''Play'', sans-serif;', 'FFFFFF', 13, 'float: left;\r\nwidth: 100px;\r\nheight: 26px;\r\nborder: none;\r\ncolor: #ffffff;\r\nbackground: none;\r\nborder-radius: 5px;\r\ncursor: pointer;\r\nmargin-right: 10px;\r\nline-height: 30px;\r\ntext-align: center;\r\nfont-size: 13px;', 'FFFFFF', '', 'FFFFFF', '', 'div_banner_menu', '5920B0', 'Atendimento:(11) 4191-1896', '''Karla'', sans-serif;', 18, '000000', 'horizontal', '464742', 'FFFFFF', 'F08800', 'FFFFFF', 'cidade', 'bairro', 'Sim', 'Sim', '595959', 'ofertas2', '', 'FFFFFF', '', '', '', '', '', 4, 3, 30, 2, 'lista', '', 'FFFFFF', '040A05', 'img', '7523f74ed3fcb891cfabfe785912daed.jpg', '3763A6', '<span>O QUE PROCURA?</span> <ul> <li>Deseja simular um <br><en>Financiamento?</en></li> <li>Envie um e-mail.<br><en>Fale conosco.</en></li> <li>Buscar um imóvel de<br><en>Alto padrão</en></li> <li>Ligamos para você!<br><en>Envie seu pedido.</en></li> </ul> ', 'lista', '', 'FFFFFF', '000000', 'FFFFFF', 'img', 'eaa2e37bbf7c0f89873f4692dee2d41c.jpg', 'FFFFFF', '<div style="width:100%;height: auto;float: left;background: #8F8F8F;font-size:18px">\r\n<nav>\r\n<ul><strong>Negócios</strong>\r\n<li onclick="window.open(''index.php?q=Vendas'',''_self'');">Vendas</li>\r\n<li onclick="window.open(''index.php?q=Locação'',''_self'');">Locação</li>\r\n<li onclick="window.open(''index.php?q=7'',''_self'');">Simuladores</li>\r\n</ul>\r\n<ul><strong>Contato</strong>\r\n<li onclick="window.open(''index.php?q=9'',''_self'');">Fale Conosco</li>\r\n<li onclick="window.open(''index.php?q=11'',''_self'');">Localização</li>\r\n<li onclick="window.open(''index.php?q=8'',''_self'');">Cadastre seu imóvel</li>\r\n<li onclick="window.open(''index.php?q=10'',''_self'');">Sobre a